-- ----------------------------
-- Table structure for article
-- ----------------------------
DROP TABLE IF EXISTS `article`;
CREATE TABLE `article` (
  `article_id` bigint NOT NULL AUTO_INCREMENT COMMENT '文章ID',
  `title` varchar(255) NOT NULL COMMENT '文章标题',
  `summary` text NOT NULL COMMENT '文章简介',
  `thumbnail` varchar(400) DEFAULT NULL COMMENT '文章缩略图地址',
  `content` longtext NOT NULL COMMENT '文章内容',
  `comment_count` int NOT NULL COMMENT '文章评论数量',
  `like_count` int NOT NULL COMMENT '文章点赞数量',
  `order_num` int DEFAULT NULL COMMENT '文章排序值',
  `status` char(1) NOT NULL COMMENT '文章状态（0：正常  1：隐藏）',
  `del_flag` char(1) NOT NULL COMMENT '文章删除标志（0正常，1删除）',
  `create_by` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '文章创建者用户ID',
  `create_time` datetime NOT NULL COMMENT '文章创建时间',
  `update_by` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '文章更新者昵称',
  `update_time` datetime DEFAULT NULL COMMENT '文章更新时间',
  PRIMARY KEY (`article_id`),
  UNIQUE KEY `article_id_index` (`article_id`) USING BTREE,
  KEY `status_index` (`status`) USING BTREE,
  KEY `create_time_index` (`create_time` DESC) USING BTREE,
  KEY `order_num_index` (`order_num` DESC) USING BTREE,
  KEY `del_flag_index` (`del_flag`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=63 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='文章表';

