CREATE TABLE `tag` (
  `tag_id` bigint NOT NULL AUTO_INCREMENT COMMENT '标签ID',
  `name` varchar(255) NOT NULL COMMENT '标签名字',
  `parent_id` bigint DEFAULT NULL COMMENT '本标签的分类名称ID',
  `order_num` char(1) DEFAULT NULL COMMENT '标签排序值',
  `status` char(1) NOT NULL COMMENT '标签状态',
  `del_flag` char(1) DEFAULT NULL COMMENT '标签删除标识',
  `create_by` varchar(255) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL,
  `update_by` varchar(255) DEFAULT NULL,
  `update_time` datetime DEFAULT NULL,
  PRIMARY KEY (`tag_id`),
  KEY `parent_id_index` (`parent_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=143 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

