-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `user_id` bigint NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `username` varchar(100) NOT NULL COMMENT '用户名',
  `nickname` varchar(100) NOT NULL COMMENT '用户昵称',
  `password` varchar(255) NOT NULL COMMENT '用户密码',
  `email` varchar(100) DEFAULT NULL COMMENT '用户邮箱',
  `phone` varchar(20) DEFAULT NULL COMMENT '用户手机号码',
  `wechat` varchar(100) DEFAULT NULL COMMENT '微信号',
  `gender` char(1) DEFAULT NULL COMMENT '用户性别（0：女   1：男）',
  `avatar` varchar(255) NOT NULL COMMENT '用户头像地址',
  `login_time` datetime DEFAULT NULL COMMENT '最后登录时间',
  `login_ip` varchar(100) DEFAULT NULL COMMENT '最后登录的IP',
  `status` char(1) NOT NULL COMMENT '用户状态（0正常  1：锁定）',
  `del_flag` char(1) NOT NULL COMMENT '用户删除标志（0正常，1删除）',
  `create_by` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '创建者',
  `create_time` datetime NOT NULL COMMENT '用户创建时间',
  `update_by` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '用户更新时间',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `username_index` (`username`) USING BTREE,
  UNIQUE KEY `email_index` (`email`) USING BTREE,
  UNIQUE KEY `phone_index` (`phone`) USING BTREE,
  KEY `nickname_index` (`nickname`) USING BTREE,
  KEY `wechat_index` (`wechat`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='用户表';

